Olchowa Kładka is a &lt;a href="village"&gt;village&lt;/a&gt; in the administrative district of &lt;a href="Gmina%20Hajn%C3%B3wka"&gt;Gmina Hajnówka&lt;/a&gt;, within &lt;a href="Hajn%C3%B3wka%20County"&gt;Hajnówka County&lt;/a&gt;, &lt;a href="Podlaskie%20Voivodeship"&gt;Podlaskie Voivodeship&lt;/a&gt;, in north-eastern &lt;a href="Poland"&gt;Poland&lt;/a&gt;, close to the border with &lt;a href="Belarus"&gt;Belarus&lt;/a&gt;. It lies approximately north of &lt;a href="Hajn%C3%B3wka"&gt;Hajnówka&lt;/a&gt; and south-east of the regional capital &lt;a href="Bia%C5%82ystok"&gt;Białystok&lt;/a&gt;.
